import React from "react";
import { Link } from "react-router-dom";
import "./Fundos.css";

const Fundos = () => {
  return (
    <div className="fundos-container">
      <h1>Fundos de Investimento</h1>

      <div className="fundos-grid">
        <Link to="/fundos/life11" className="fundo-card">
          <h2>FII - LIFE11</h2>
        </Link>

        <Link to="/fundos/lred11" className="fundo-card">
          <h2>FII - LRED11</h2>
        </Link>

        <Link to="/fundos/lsoi11" className="fundo-card">
          <h2>FII - LSOI11</h2>
        </Link>

        <Link to="/fundos/tera11" className="fundo-card">
          <h2>FII - TERA11</h2>
        </Link>
      </div>
    </div>
  );
};

export default Fundos;
